import Card from "../../Components/UI/Card"
import RemovedTodo from "./RemovedTodo"

const RemovedTodoList = (props) =>{
//console.log(props)
    const removedItems = props.removedList.map(todo => <RemovedTodo activity={todo.activity}/>)
//console.log(removedItems)
    return(
        <Card>
<ul>{removedItems}</ul>
        </Card>
    )

}

export default RemovedTodoList
